s.x:
var $bm_rt;
var chkbx;
$bm_rt = chkbx = thisComp.layer('Cursor').effect('Click')('Checkbox');
if (chkbx == 1)
    $bm_rt = [
        80,
        80
    ];
else
    $bm_rt = [
        100,
        100
    ];

d.x:
var $bm_rt;
var end;
var sign = '|';
var blinkInterval = 15;
var i = effect('Slider Control')('Slider');
var on = effect('Checkbox Control')('Checkbox');
var frames = timeToFrames(time);
var check = $bm_div(frames, blinkInterval);
if (on == 1) {
    if (i.valueAtTime(time + thisComp.frameDuration) > i) {
        end = sign;
    } else {
        if ($bm_mod(Math.floor(check), 2) == 0) {
            end = sign;
        } else {
            end = ' ';
        }
    }
} else {
    end = ' ';
}
$bm_rt = $bm_sum(text.sourceText.substr(0, parseInt(i)), end);

